import React, { useState } from 'react';
import styles from './SearchBar.module.css';

const SearchBar = () => {
    const value = useState()
    return (
      <div className={styles.SearchBar}>
        <input
          //onChange={this.onTextChanged}
          type="text"
          placeholder="Search by App"
        />
      </div>
    );
}
 
export default SearchBar;
